const mockData = {
  content: [
    {
      type: "linegraph",
      data: {
        xData: ["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
        yData: [10, 20, 30, 20, 40, 50],
        title: "Sample Line Graph",
      },
    },
    {
      type: "table",
      data: {
        rows: [
          {
            id: 1,
            Test: "Parameter 1",
            Value: "Value 1",
            Result: true,
          },
          {
            id: 2,
            Test: "Parameter 2",
            Value: "Value 2",
            Result: false,
          },
          {
            id: 3,
            Test: "Parameter 3",
            Value: "Value 3",
            Result: false,
          },
          {
            id: 4,
            Test: "Parameter 4",
            Value: "Value 4",
            Result: true,
          },
          {
            id: 5,
            Test: "Parameter 5",
            Value: "Value 5",
            Result: true,
          },
        ],
      },
    },
  ],
};

export default mockData;
